client.connect(function(err) {
  assert.equal(null, err);
  console.log("Connected successfully to server");

  const db = client.db(dbName);

  db.collection('user').insertOne(
    {
      name: "joe",
      last: "Matteson",
      year: 4
    }
  )

  client.close();
});
